import React from 'react';

const NewComponent = (props) => {
    return (
        <>
            <h1>Hello React!</h1>
            <p>My name is {props.name}.</p>
            <p>I am {props.age} years old,</p>
            <p>my gender is {props.gender}.</p>
        </>
    );
};

NewComponent.defaultProps = {
    name: "user X",
    age: "30",
    gender: "남",
};

export default NewComponent;
